INSERT INTO `board_notice` VALUES (1,'[공지] 게시판 이용 안내','<p><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\">안녕하세요? 푸른별 운영진입니다.</span><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"><b style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\">1. 게시물의 저작권과 책임</b><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\">갤러리에 올리시는 게시물(댓글 포함)의 저작권은 게시자 본인에게 있으며, 타인의 권리를 침해해서는 안 됩니다.</span></p><p><br style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"></p><p><span class=\"tit\" style=\"line-height: 1.5; color: rgb(0, 0, 0); font-weight: bold; display: block; font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\">게시물의 저작권과 책임</span></p><ul class=\"useinfo-lst\" style=\"margin: 5px 0px 0px; padding: 0px; list-style: none; color: rgb(0, 0, 0); font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\"><li style=\"margin: 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">① 게시판 및 갤러리에 게시한 게시물의 저작권은 게시자 본인에게 있습니다.</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">② 작성한 게시물로 인해 발생되는 문제에 대해서는 해당 게시물을 게시한 게시자에게 책임이 있습니다.</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">③ 게시판 및 갤러리에 작성된 게시물이 타인의 저작권, 프로그램 저작권 등을 침해할 경우 이에 대한 민, 형사상의 책임은 글 게시자에게 있습니다. 만일 이를 이유로 회사가 타인으로부터 손해배상청구 등 이의 제기를 받은 경우 해당 게시자는 그로 인해 발생되는 모든 손해를 부담해야 합니다.</li></ul><p><br></p><p><br></p><p><span class=\"tit\" style=\"line-height: 1.5; color: rgb(0, 0, 0); font-weight: bold; display: block; font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\">게시물 삭제 기준</span></p><ul class=\"useinfo-lst\" style=\"margin: 5px 0px 0px; padding: 0px; list-style: none; color: rgb(0, 0, 0); font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\"><li style=\"margin: 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">① 타인에게 수치심, 혐오감, 불쾌감을 일으키는 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">② 타인의 사생활 침해, 명예훼손, 개인정보(이름, 주민번호, 연락처, 사진) 등을 게시한 경우</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">③ 타인을 협박, 위협하는 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">④ 해당 갤러리의 주제와 동떨어진 내용으로 지속적으로 분란을 야기하는 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑤ 타인의 게시물을 무단 캡처 후, 본인의 게시물에 첨부하여 지속적으로 분란을 야기하는 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑥ 홍보성 타 사이트 링크 포함 및 광고 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑦ 저작권 침해 게시물<ul class=\"useinfo-lst-inner num\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">1) 저작권자의 동의 없이 자료를 불법 게시, 배포, 복제하는 경우</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">2) 저작권이 있는 소프트웨어 불법 다운로드 및 시리얼 넘버를 공유하는 경우</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">3) 의도적인 분란 조장 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑧ 음란성 게시물<ul class=\"useinfo-lst-inner num\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">1) 외설적인 내용으로 성적 수치심과 혐오감을 유발하고 일반인의 성 관념에 위배되는 경우</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">2) 남녀의 성기, 음모, 항문을 묘사하거나 성행위 등을 표현하는 경우</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">3) 윤락행위를 알선하거나 성관계를 목적으로 하는 만남 알선 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑨ 아동·청소년 대상 음란성<ul class=\"useinfo-lst-inner num\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">1) 아동·청소년 성착취물을 제작 및 배포하는 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">2) 아동·청소년 성착취물임을 알면서도 소지하거나 배포하는 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">3) 아동·청소년의 성적 대상화 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">4) 아동·청소년 대상 성범죄 및 성매매를 모의하거나 묘사, 조장하는 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">5) 아동·청소년에게 음란물이나 성착취물을 제공하는 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">6) 아동·청소년에게 성인 도구를 판매하는 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">7) 아동·청소년으로 인식될 수 있는 표현물에 대한 성착취 게시물</li><li style=\"margin: 0px; padding: 0px; list-style: none; position: relative;\">8) 그 외 아동·청소년 대상 성범죄 관련 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑩ 불법 프로그램 및 악성코드 등이 포함된 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑪ 의미 없는 내용, 도배성 게시물</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\"><br></li></ul><p style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\"><span class=\"tit\" style=\"font-size: 14px; line-height: 1.5; color: rgb(0, 0, 0); font-weight: bold; display: block; font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\">게시물 신고게시판 이용 관련</span></p><ul class=\"useinfo-lst\" style=\"margin: 5px 0px 0px; padding: 0px; list-style: none; color: rgb(0, 0, 0); font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\"><li style=\"margin: 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">① 신고게시판에 지속적인 욕설, 도배성, 협박, 음란, 허위 신고를 작성한 경우</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">② 삭제된 게시물 관련 신고 시 삭제된 글의 작성일자, 제목, 작성자 등을 자세히 적어 신고해 주셔야 확인 가능하며 운영자가 문제 게시물이라 판단하여 삭제된 게시물의 복구는 불가능합니다.</li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">③ 저작권 침해 게시물 삭제 요청 시, 본인의 지적재산권이 침해된 게시물을 발견할 시 아래 사항을 첨부하여 문의해 주시기 바랍니다.<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">본인이 해당 자료의 지적재산권자, 혹은 그런 권한을 가지고 있다는 사실을 입증하는 자료</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">저작권이 침해되었다고 판단되는 게시물의 정확한 주소</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">본인, 대리인의 성명, 상호 및 연락처, 신고 사유, 사업자 등록증</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">④ 탈퇴 후 삭제하지 못한 게시물의 경우<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">탈퇴 전에 게시물 삭제를 하고 탈퇴해야 하며 탈퇴 후 삭제는 불가능합니다.</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">직접적인 개인정보가 노출된 게시물(이름, 연락처, 주소, 사진)에 한해 해당 게시물 URL을 게시물 신고게시판에 남겨 주시면 처리됩니다.</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">⑤ 이벤트 공지사항 신청 시<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">갤러리 내에서 주최하는 이벤트가 아닌 경우 공지 등록 불가</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">타 사이트 연합 및 유도성 게시물</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">공동구매 게시물은 공지 등록 불가</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">저작권 관련 영상 게시물 등록 불가</li></ul></li></ul><ul class=\"useinfo-lst2\" style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; color: rgb(210, 34, 39); font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">방문 및 전화상담은 하고 있지 않사오니 신고게시판을 이용해 주시기 바랍니다.</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">공지사항 및 자동 짤방 관련 신청은 평일 정상 업무시간에만 처리 가능합니다.</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">신고한다고 해서 모든 게시물이 삭제 조치되는 것은 아닙니다.</li></ul><ul class=\"useinfo-lst\" style=\"margin: 5px 0px 0px; padding: 0px; list-style: none; color: rgb(0, 0, 0); font-family: AppleSDGothicNeo-Regular, HelveticaNeue, 나눔고딕, NanumGothic, 돋움, Dotum, sans-serif; letter-spacing: -1px;\"><li style=\"margin: 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓐ 도배<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">한 갤러리나 여러 갤러리를 돌아다니면서 동일한 내용을 반복 게시하는 경우</li><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">동일하지 않은 내용이나 빠른 시간에 글을 게시하여 갤러리 이용에 지장을 주는 경우</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓑ 저작권<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">음원, 동영상, 사진, 기사 전문 등 저작권을 가지고 있는 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓒ 광고<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">다단계, 경품 지급, 불법 대포(폰, 차), 19금 이상 윤락업소 광고 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓓ 욕설, 비방 게시물<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">심한 욕설 및 정치, 지역, 성별, 인종에 대한 비방 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓔ 국제범죄 관련 게시물<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">마약, 불법 총기 소지, 사제폭탄 제조법 등을 올린 게시물</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓕ 허위사실 유포<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">개인, 기업 및 단체에 대한 비방성 게시물 및 허위사실을 유포하는 경우</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓖ 개인정보 유출<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">타인의 사진, 이름, 주민등록번호, 전화번호 등이 정확하게 노출되어 있는 게시물 및 웹페이지 링크를 게시하는 경우</li></ul></li><li style=\"margin: 10px 0px 0px; padding: 0px; list-style: none; font-size: 13px; line-height: 1.5; color: rgb(85, 85, 85);\">ⓗ 권리침해 게시물<ul class=\"useinfo-lst-inner\" style=\"margin-top: 3px; margin-right: 0px; margin-left: 13px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px 0px 0px 10px; list-style: none; position: relative;\">게시된 내용으로 권리침해를 입은 당사자가 소명자료와 함께 직접 삭제를 요청하는 경우</li></ul></li></ul><p><span style=\"font-family: -apple-system, BlinkMacSystemFont, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;맑은 고딕&quot;, arial, 굴림, Gulim, sans-serif; font-size: 13px;\"><br></span><br></p>','2023-02-06 09:34:30.504358',6);
